'일합니다. 연락주세요.전기',NULL,'주로 전기 태양광쪽에서 일했구요\n물류창고 오피스텔 골조 했어요\n내선일 배우려고 아시는분과 일했는데 다시 태양광일 하셔서 지방을 너무 돌아다녀서\n서울경기쪽으로 숙식되는 곳으로일하고 싶어요.\n주5일에 잔업 많은곳좋구요. 현장에 따라 탄력근무도 가능해요.\n처음에 만나서 일하는거라 초보로 생각하시면 되구요 일하시는거 보시고 판단해주세요.\n전공은 아니구요. 전기 관련기구는 다 사용할줄알고 자재이름도 왠만한건 다알아요.\n개인공구도 있어요.\n성실하게 열시미 일할수 있으니까. 연락주세요.\n급여만 괜찮으면 외장목수쪽도 관심있어요\n숙소는 모텔쪽 이였으면 좋겠어요...\n예전에 아파트나 오피스텔은... 더럽고 청소가 잘 안되있더라구요... 일도중요한데 숙소도 중요합니다. 사람 많고 화장실 부족하고 그런곳은..힘드네요.\n',5423181110221453,1,NULL,'2019-01-04 13:42:49',176,0,226,NULL,NULL,'열심히살자',NULL,NULL,NULL,'010-4741-5423','1','12','N','N',NULL,NULL,127.0564716,37.6543543,1,'user/5423181110221453/20180814_172615.jpg,user/5423181110221453/20180714_130945.jpg,user/5423181110221453/20180730_084436.jpg','user/5423181110221453/20180814_172615.jpg',34,'M',172,98,'Y',NULL,'N','N','99','0','Y',0,0,0,0,NULL,NULL,NULL,NULL
