'열심히 최선을 다하겠습니다',NULL,'이력서 보기\n\n자기소개서\n\n내용수정\n\nPC버전보기\n2018.12.31 (월)최종수정\n\n김호준답게 될때까지 노력하겠습니다. 수정\n\n김호준 수정\n남자, 1995년생 (24세)\n구직중\n\n010-3599-5853\n\n-\n\nkhjkjh159@naver.com\n\n(300-825) 대전 동구 용전동 28-11\n\n학력사항\n고등학교 졸업\n\n경력사항\n신입\n\n희망연봉/고용형태\n회사내규에 따름/정규직 \n\n희망근무지\n대전전체\n\n수정\n\n학력\n\n내용수정\n\n최종학력: 고등학교 졸업\n\n대전체육고등학교2011.03 ~ 2014.02 졸업예체능계 (레슬링)\n\n자기소개서\n\n내용수정\n\n김호준답게 될때까지 노력하겠습니다.\n\n[성장과정]\n\n- 김호준답게 될때까지\n저는 중·고등학교때 체육중학교 체육고등학교에서 활발이 레슬링을 했습니다. 남들보다 좀 더 끈기와 목표의식이 뚜렸해 항상 최고가 되기 위해 노력했습니다. 운동을 하는 내내 저의 종목으로 1등을 놓친적이 없으며, 전국체전에서 금메달을 얻었습니다. 한번 시작한 일은 무슨 일이든 끝을 맺어야 한다는 생각으로 끝까지 마무리 지려하며, 제게 주어진 일은 무슨 일이든 열심히 노력하는 성격입니다. \n\n\n[성격의 장·단점]\n\n- 언제나 즐겁게\n사교적인 편이라 누군가와 가까워지는 데 시간이 오래 걸리지 않습니다. 사람 간의 관계에서 복잡하거나 계산적인 것을 싫어해서 다소 손해를 보는 일이 있어도 솔직하게 살고자 하는 것이 제 인생목표이지만, 남에게 싫은 소리를 잘하지 못하는 게 제 단점이기도 합니다. 어지간한 일은 웃으면서 해결하고 싶은 생각이 강해 낙천적이라는 소리도 많이 듣곤 합니다. 그래서 혼자서 화를 삭이는 일도 종종 일어나지만, 그마저도 금방 잊고 훌훌 털어버리는 편입니다. 가슴에 안좋은 감정을 담아두지 못하는 성격입니다.\n\n\n[입사 후 포부]\n\n- 늘 발전하는 김호준이 되겠습니다.\n지속적인 관심과 부단한 노력만이 5월의 싱그러운 꽃나무를 피워냅니다. \n오늘 하루를 열심히 사는 제 모습이 더욱 값지다고 생각합니다. 귀사를 마른나무로 만들지 않기 위한 저의 싱그러운 하루를 선사하고 싶습니다. 제 신념은 제가 있는 자리를 지키며 회사에 플러스가 되도록 항상 능동적이며 적극적으로 생활한다는 것입니다. 이러한 신념으로 귀사의 발전에 기여할 수 있는 작은 일원으로서 항상 배우는 자세로 열심히 노력할 것입니다. 다른 머리가 좋은 사람들, 잔머리를 잘 굴리는 사람들, 학벌이 좋은 사람들을 닮아가려는 제가 아닌 김호준다운, 나 자신보다 항상 상대방을 배려할 줄 알고 일 할 때는 그 일에 누구보다 몰두하고 즐기고 놀 때는 확실하게 화끈하게 노는 사원이 되겠습니다. 또한, 입사하는 것에 안주하지 않고 업무 능률 향상과 개인 역량의 증진을 위해 부지런히 자기계발에 노력을 기울이겠습니다.\n\n위의 모든 기재사항은 사실과 다름이 없음을 확인합니다.\n2018년 12월 31일 (월) / 작성자 : 김호준\n\n',5853181231174455,1,NULL,'2019-11-01 07:48:25',110,0,353,NULL,NULL,'김묵지',NULL,NULL,NULL,'010-3599-5853','1','13','N','N',NULL,NULL,127.432663,36.3271,1,'user/5853181231174455/1546169084634.jpg','user/5853181231174455/1546169084634.jpg',25,'M',178,90,'Y',NULL,'N','N','99','0','Y',0,0,0,0,NULL,NULL,NULL,NULL
