'일한다는건좋은거다',NULL,'지원동기 회사는 좋은 인재를 원합니다. 좋은 인재 또한 좋은 회사를 알아봅니다. 글로벌화된 회사 에서 좋은 인재로 도약하고 싶습니다. 능력을 키워서 꼭 필요한 인재로서 성장하고 싶습니다. 가능성을 믿고 저에게 기회를 주셨으면 좋겠습니다. 저에게 기회를 주신다면, 항상 성실하고 책임감 강한 태도로 주어진 모든 일에 최선을 다할 것입니다. 늘 솔선 수범하는 자세로 완벽한 일 처리를 위해 노력하겠습니다. 함께 근무하는 동료들에게 항상 신뢰와 믿음을 줄 수 있는 사원이 되겠습니다. 또한 언제 어디서나 꼭 필요한 인재가 되기 위해 최선을 다하겠습니다. 성장과정 청주토박이로 어려서부터 한 지역에서 생활해왔습니다. 그래서 오랜 친구를 사귈 수 있는 좋은 점도 있었으나, 시골생활에 대한 동경심이 많았습니다. 부모님의 사랑과 책임감을 배웠습니다. 그리고 동년배 친구들에 비해 독립심이 유난히 강했습니다. 그런 독립심으로 인해 법을 배울 수 있었으며저는 어린 시절부터 모든 것을 스스로 하는 그로 인해 책임감이 강한 사람으로 행동할 수 있었습니다. 때문에 일찌감치 부모님으로부터 독립하여 군 제대 지금까지 부모의 경제적인 도움 없이 살아온 생활이 제 스스로 뿌듯합니다. 지금도 부모님에게서 독립된 생활을 하고 있으며 그로 인해서 혼자서 열심히 살아가야겠다는 다짐을 하게 됩니다. 성격소개 저는 항상 정직하자는 신념으로 살아왔습니다. 또한 상식이 통하는 사람이 되자. 항상 노력을 하면 반드시 기회는 온다고 믿습니다. 제 성격은 긍정적인성격을 가지고. 주위사람들은 저를 보고 발다는 말을 만희 합니다. 그래서 주위 사람들과 잘 융합합니다. 저는 저에게 주어진 일에 대해서는 최선을 다하려고 노력하고 그 일에 대해서는 전문가가 되고자 합니다. 일과 함께 그것을 함께 하는 사람들과의 관계도 소중하다고 믿기 때문에 동료들과 항상 웃음을 잃지 않으려고 노력합니다. 이것이 저로 하여금 집단 내에서 원만한 인간관계를 유지할 수 있도록 해준 밑거름되기 위해 최선을 다하고 있습니다. 간혹 인간관계로 인해서 상처를 받게 되는 경우도 있지만 그런 어려움들도 모두 이겨낼 수 있는 넓은 마음을 갖도록 자신을 돌아보는 생활을 하고 있습니다. 취미 및 특기 헬스 하는 것이 유일한 취미입니다. 일에 대한 스트레스가 쌓이게 되면 운동을 하게되고 그런 통해서 저 자신을 돌아보게 되는 시간을 가질 수 있었습니다. 끊임없이 운동을 하면 어느 순간 저자신을 볼 수 있게 됩니다. \n\n 이전\n\n\n',8193181230104800,1,NULL,'2018-12-30 10:56:11',0,0,179,NULL,NULL,'',NULL,NULL,NULL,'010-7777-8193','1','14','N','N',NULL,NULL,127.488975,36.6424987,1,'','',36,'M',173,64,'Y',NULL,'N','N','99','2','Y',0,0,0,0,NULL,NULL,NULL,NULL
