'현장 유도원 구직 원합니다.',NULL,'2017년 1월부터 2018년 7월까지 고덕 삼성현장에서 유도원일 했습니다. 처음 한 달 가량은 업체  안전 관리 보조일을 했구요. 그 이후로 전기업체 유도일을 보게 되었는데 대부분 포설팀 유도일을 했습니다. \n나이는 51세지만 나이보다는 젊게 보이는 편이고, 대체로 긍정적인 시각으로 보는 편이라 그런지 늘 밝은 표정의 얼굴이라고 주변 사람들이 칭찬합니다. 같이 일하는 반장님들을 위해 도움이 되고싶어 작은 일이라도 안 놓치고 살펴주려는 세심함은 있으나, 말은 그닥 많지 않은 편입니다. 개인적인 이유로 결근은 한 번도 안했으니 근태는 확실합니다.\n고덕쪽  1기 공사가 마무리되는 단계라 어쩔수 없이 대기상태가 되어 구직을 신청하게 되었습니다. 아직 맘편히 쉴 나이가 아닌듯 싶어서...',3503180731173658,1,199,'2018-07-31 17:57:07',470,0,331,NULL,NULL,'오로라',NULL,NULL,NULL,'010-4799-3503','1','10','N','N',NULL,NULL,127.112763,36.992368,1,'user/3503180731173658/1495594640312.jpg,user/3503180731173658/1486955844406.jpg,user/3503180731173658/20161018_152930_HDR.jpg','user/3503180731173658/1495594640312.jpg',51,'F',156,58,'Y',NULL,'N','N','0','0','Y',0,0,0,0,NULL,NULL,NULL,NULL
