'목수 또는금속 인테리어 구직 희망합니다',NULL,'안녕하세요.\n가게 일을 하면서 취미로 작은 공방을 얻어 이것저것 만들다 보니 \n\n만족감과 성취감에 대해 갈증이 생겼습니다.\n\n전문적인 기술과 배움이 필요한 것을 느꼈고 손으로 만들고 사람들과 \n소통하는 게 더 좋은 것을 깨닫게 되어 좋아하는 취미가 직업이 되면 정말 좋겠다는 생각이 들어\n\n이번에 가게를 정리 하게 되었습니다.\n\n\n전문적인 기술은 가지고 있지는 않지만, 손으로 만들고 표현하는 게 좋습니다. \n배우려는 태도와 즐기면서 일하는 긍정적인 모습으로 일하겠습니다.\n\n\n\n좋은 인연을 희망해 봅니다.\n\n\n37살/파주야당동/0104242162사/자차있음\n\n(지금백수/자차있음/가정있음/1종보통면허/동력수상레저기구2급면허/2종소형면허/전기공사기능사)\n',1624180814133945,1,NULL,'2018-08-14 13:47:07',221,0,252,NULL,NULL,'필스팩토리 ',NULL,NULL,NULL,'010-4242-1624','3','0','N','N',NULL,NULL,126.7798239,37.7599478,1,'user/1624180814133945/_MG_2839.jpg','user/1624180814133945/_MG_2839.jpg',37,'M',175,68,'N',NULL,'N','N','99','0','Y',0,0,0,0,NULL,NULL,NULL,NULL
