'구직희망합니다.',NULL,'저는 고등학교 졸업후 미국 Michigan으로 이민을 갔습니다.\n호텔 경영에 뜻을 품고 Business Management를 전공하였고 졸업후 Portland,OR 에 위치한 Best Western Rose Garden Hotel에서 근무하였습니다.\n호텔 메니져로서 주업무는 고객관리. SALES & 마케팅 업무를 하였습니다.\n하지만 2002년 한국으로 돌아와 조선업계로 전환하였고 COATING 분야를 공부하머 자격증 취득후\n 조선소.도료 메이커 회사에 근무하였고 2008년부터는 외국계 선사에 입사하여 신조도장감독으로 일했습니다.\n미국과 한국에서 학창시절 및 사회생활을 모두경혐하였습니다.\n저에 풍부한 경험이 귀사에 도움될거라 확신하며\n필요한 구성원이 되겠습니다.',6343180814144744,1,NULL,'2018-08-14 14:55:37',168,0,252,NULL,NULL,'xtcat800',NULL,NULL,NULL,'010-2975-6343','2','3600','N','N',NULL,NULL,129.4166292,35.5048448,1,'user/6343180814144744/Screenshot_20180316-084722.jpg,user/6343180814144744/20180730_134850.jpg','user/6343180814144744/Screenshot_20180316-084722.jpg',49,'M',177,80,'Y',NULL,'N','N','0','99','Y',0,0,0,0,NULL,NULL,NULL,NULL
