'지원 희망합니다.',NULL,'사람으로서 도리를 다하고 하늘의 뜻을 기다린다는 말이 있습니다. 제가 인생을 살며 가장 많이 들어왔던 것이고 많은 영향을 받은 말입니다. 이를 지키기 위해 노력하는 것이 제가 살아온 방향입니다.\n  \n사람이 하는 모든 일에는 그 사람의  기운이 깃든다고 합니다. 그 기운이 함께하는 이에게 힘이 될 수도  있고 독이 될 수도  있다고 하는데요. 힘이 되도록 해 보겠습니다. 노력하는 모습 보여 드리겠습니다.\n  \n저는 목표가 있습니다. 제가 지금 지원하는 이 업종과  \n전혀 다른 방향의 목표입니다.하지만 다른 길이라   \n생각하지 않습니다. 제가 맡은 모든 일에 도리를 다할 때 그 길이  목표로 이끌어 줄 거라고  믿고 맡은 일에 최선을 다하겠습니다. \n  \n긴 글  읽어 주셔서 감사합니다.  \n채용해 주신다면 실망시켜 드리지 않겠습니다.',5060180815103216,1,NULL,'2018-09-24 23:10:07',77,0,274,NULL,NULL,'지원희망자',NULL,NULL,NULL,'010-7928-5060','1','12','N','N',NULL,NULL,126.8319831,37.6583981,1,'user/5060180815103216/최영훈님.jpg,user/5060180815103216/20180412_115136.jpg','user/5060180815103216/최영훈님.jpg',31,'M',173,62,'N',NULL,'N','N','99','0','N',0,0,0,0,NULL,NULL,NULL,NULL
