'금속일 및 조공 데모도 일 가능합니다.',NULL,'\n010-4227-76이공입니다.\n20대 중반 남성입니다.\n서울, 부천, 인천 수도권 지역 일 가능합니다.\n자차 보유중입니다.\n\n타일 그라인더 카타기 믹서 가능합니다.\n메지는 좀 느려요^^\n\n금속인테리어 절단기 그라인더 아크용접 가능 합니다. 하지 작업  데크하지 및 도면 보여 주시면 맞춰서 작업합니다.\n\n목공 석고 , 가벽, 데크, 가구, 선반등 가능합니다.\n아직 인테리어 목수 일에는 준기공엔 못 미칩니다.\n\n샌드위치 판넬 하지 작업 및 시공 가능합니다.\n\n데코타일이나 강마루 시공도 가능하나 조그만 평수만 연락주세요^^ 기공 물량은 못 뽑습니다.\n\n전기 레일설치 및 등기구 교체작업도 가능합니다.\n\n페인트 보양 및 오일 스테인 수성 유성 붓 로라질도 가능합니다.\n\n양중이나 곰방도 하고 있습니다.\n\n간단한 작업부터 해서 단가는 13부터 받고 있어요.\n작업내용과 단가 문자로 보내주시거나 전화로 연락해주세요. \n\n연락처는 010-4227-76이공입니다.\n최대한 마감 깔끔하게 작업하도록 하겠습니다.\n( 장비는 소유하고 있지 않아서 장비가 필요한 작업은 클라이언트 분께서 대여를 하시거나 가지고 게셔야 작업이 가능합니다.)',7620180403183635,1,NULL,'2018-08-24 13:29:32',52,0,136,NULL,NULL,'페루',NULL,NULL,NULL,'010-4227-7620','1','14','N','N',NULL,NULL,126.650584,37.463523,1,NULL,'',26,'M',165,60,'Y',NULL,'N','N','99','2','Y',0,0,0,0,NULL,NULL,NULL,NULL
