'근태좋고 성실한 조공 28살',NULL,'전기조공 10개월\n안전감시 6개월 \n비계 2개월 경험해봤습니다\n\n전기조공은 12~12.5 정도 생각하고 있고\n연장이 조금이나마 있는 현장을 찾고있습니다 \n공수가 26~30정도 나오는 현장을 찾아요\n팀장님들 연락 부탁드릴게요\n01031213833\n\n활발한 편이라 외부공사도 좋아합니다\n\n비계는 내부비계, 외부비계 둘다 상관없습니다\n비계 제대로 배우면서 역량 쌓고 싶습니다\n비계 역시 공수가 좀 나왔으면 좋겠습니다(24~28)\n비계팀장님들 똘똘한 조공 데려가세요!\n\n성격은 둥글둥글 쾌활합니다\n사교적이어서 금방 현장에 적응하는 편입니다\n\n자차있어서 멀리 이동 가능합니다\n\n모두 좋은하루 보내세요',3833190124200451,1,NULL,'2019-05-24 09:41:55',1273,2,127,NULL,NULL,'레닉',NULL,NULL,NULL,'010-3121-3833','1','12','N','N',NULL,NULL,0,0,1,'user/3833190124200451/20180907_190720(0).jpg','user/3833190124200451/20180907_190720(0).jpg',28,'M',178,75,'Y',NULL,'N','N','0','99','Y',0,0,0,0,NULL,NULL,NULL,NULL
