'방송사 취재차량',NULL,'저는 경북 칠곡군 인동면에서 장남으로 태어났습니다.\n1966년 가족이 부산으로 이사하여 화랑초교, 대신중교,\n대동고교를 졸업하고 가정 형편상 대학은 못갔습니다.\n1979년 서울신탁은행에 입사하여 서울 홍은점으로 발령\n받아 서울로 상경하게 되었습니다.\n1982년 10월 군입대, 1983년 12월 만기제대 하였습니다.\n외아들인 관계로 방위 12개월 복무하였습니다.\n회사에 복직하지는 않았고 2개월간 쉬다가 현대중공업\n울산사업소에 품질관리부서에 입사하였습니다.\n3년정도 다니다가 모친께서 큰병에 걸리셔서 회사를 그만\n두고 모친 병간호를 1년간 하였습니다.\nLG패션 제품관리 영업에 5년간 근무하였으며, 한국에스웨이 파견직으로 채널A 취재차량 운전자로 7년간\n근무한후 계약종료로 인하여 퇴사하게 되었습니다.\n현재는 구직중에 있습니다.\n저의 성격은 매우 낙천적이며 긍정적 입니다.\n맡은 업무에 성실하고 창의적으로 일하는 편입니다.\n새로운 직장에 입사하게되면 회사의 발전을 위해 저의 열정을 받치고 싶습니다.',8570190127204004,1,NULL,'2019-01-27 21:19:40',36,0,128,NULL,NULL,'어쩌다 발명',NULL,NULL,NULL,'010-9852-8570','2','2400000','N','N',NULL,NULL,126.8319831,37.6583981,1,'user/8570190127204004/Screenshot_20190127-211851_Gallery.jpg','user/8570190127204004/Screenshot_20190127-211851_Gallery.jpg',59,'M',175,95,'Y',NULL,'N','N','2','99','Y',0,0,0,0,NULL,NULL,NULL,NULL
