'적응빠른 인재입니다.',NULL,'성장과정\n[늘 끊임없이 도전하여, 잠재력을 발휘하는 능력]은 제가 살아온 환경에 의해서 강해졌습니다.\n어머니 없이, 가부장적인 아버지와 공황장애로 인하여 심한 강박증과 치매를 앓고 계시는 할머니 밑에서 자라, \n어린 시절부터 대부분의 집안일을 책임져왔고, 중학교 이후부턴 아르바이트를 하여 생계도 보태며 학업을 이어왔습니다. \n가족을 원망하진 않았으나 힘들었습니다. 이 환경이 정녕 나에게 도움이 될지, 내 앞길을 막고만 있는 것은 아닐지 고민도 많이 되었고, 어린마음에 이곳에서 벗어나고 싶어 방황도 해봤습니다. \n그러던 중 어느 날, 학교에서 교내 수필쓰기 대회가 열렸습니다. \n평소 새로운 것에 도전하여 숨어있던 잠재력을 발견하는 것을 좋아하던 터라, 수필이 글쓴이의 개성과 인간성을 나타내 준다는 말을 듣고 도전하게 되었습니다. 또한 집중력을 발휘하여 최선을 다해 노력한 성과를 인정받을 때가 가장 설레고 뿌듯하기에 그동안의 삶과 경험을 진지하고 긍정적으로 돌아보며 적극적으로 작성한 결과, 결국 대상을 받게 되었습니다. \n이 일을 통해 제 환경을 긍정적으로 생각하는 계기가 되었고 앞으로도 제 존재의 이유이신 아버지와 할머니를 책임지며 우리가족이 일어설 수 있도록 노력하고자 다짐하게 되었습니다. \n마찬가지로 회사에 다니면서 저를 가로막는 무언가가 있다한들 늘 인간성을 잃지 않고, 바퀴벌레처럼 끊임없이 도전하고 살아남아 고난을 헤쳐 나갈 자신이 있으며, 장점인 집중력을 발휘하여 새로운 것에 도전해 저와 동시에 회사의 성장을 도울 것을 약속드립니다.\n\n업무 중, 어려움을 극복한 사례 \n[어떠한 역경도 함께 헤쳐 나가겠습니다.]\n패밀리 레스토랑에서 근무했을 때, 주방의 물이 Bar로 역류해 물바다가 된 적이 있습니다.\n수리기사분의 도움으로 역류는 멈췄지만, 배수구가 없던 Bar에 고인 큰 물웅덩이는 바쁜 상황 속 모든 직원에게 업무의 방해요소가 되었습니다. 열악한 업무환경이 되어 큰 스트레스였던 물웅덩이를 청소하려는 직원이 아무도 없자, 점심시간에 식사만 하고 나와 청소하였습니다. 결과로, 업무방해 요소가 없어진, 예민해져 있던 모두가 즐거워졌고 서비스의 질도 좋아져 해당시간 객단가가 평소 다른날, 같은 시간 객단가의 2배로 높아짐을 경험하였으며 이로 인해 소수의 힘일지라도 함께하려는 마음이 있다면 다 같이 성장해 나갈 수 있다는 것을 느끼게 되었습니다. 이를 나중에서야 알게 된 매장점주님이 추가근무에 대한 보상을 해주었지만, 그 보다 이 경험을 통해서 느낀 것들과 다른 직원들에게 받은 감동, 감사함이 더욱 꿀맛 같음을 느낀 계기가 되었습니다. 이처럼 회사와 동료를 위해 어떤 상황도 헤아릴 줄 알며 함께 헤쳐 나가는 직원이 되고, 더 나아가 이 회사가 더욱더 세상 모든 사람과 함께 발전해나가는 회사로 성장할 수 있도록 도울 것을 약속드립니다.\n\n장점 및 단점\n[업무에 대한 책임감과 동료애가 뛰어납니다.]\n분대장을 일찍 달아 업무 멘토가 없었던 행정병 시절, 믿음직한 리더가 되기 위해 일과시간이 지나도 업무에 많은 시간과 관심을 쏟았습니다. 또한 언제나 후임들의 환경이나 고충에 대해서 귀 기울이고, 조언도 아낌없이 해주며, 휴가나 외박 때면 가끔 맛있는 음식으로 응원해 주고 항상 다른 간부들에게 후임들의 칭찬을 하였습니다. 그럴수록 잘 따라와 주는 후임들의 마음이 너무 감사하였고 그 마음에 보답하기 위해 더욱 더, 맡은 일에 책임감을 갖고, 힘을 낼 수 있었습니다. 그로 인해 업무능력이 빨리 향상되었으며 후임들의 업무 멘토가 되었고, 결국! 작년 가을, 부대 내 정기 감사에 큰 영향력을 주었고 전우들과 간부들의 추천으로 대대장님께 표창을 받았습니다! 전역 후에도 후임들과 자주 만나, 군 시절의 추억도 상기시키며 감사를 전하고 있으며 앞으로도 제 인생에서의 값진 경험이 될 것입니다.\n맡은 일을 책임감 있게 하려는 마음이 크다보니 목표를 이루지 못했을 때 낙담하는 경우가 있습니다. 업무에 더 많은 지속적인 관심을 가지고 업무적으로 부족한 부분을 보완해 나가며 작은 일부터 하나하나 개선해 나간다면 매사에 성취감을 느끼고 더 발전하는 직원이 될 것이라 확신합니다.\n\n입사 후 포부\n제 가치관인 끝없이 배우려는 마음가짐으로 [탁월한 전문인력]이 되겠습니다.\n레스토랑에서 일하면서 더욱 매장을 위하며, 매장을 방문하는 고객에게 더 나은 서비스를 제공하기 위해선 직원도 최대한 많은 것을 알아야 한다고 생각하여 서빙으로 시작한 일에서 나아가 바텐더와 주방조리직을 함께 지원하였습니다. 동일한 매장안에서 여러분야의 일을 하다보니, 서빙을 하면서 음료, 주류, 음식에 대해서 다른직원보다 더욱 세세하게 많은 정보를 알게되어, 고객이 궁금해 하는것에 대한 원하는 답변을 충분히 할 수 있었으며 또한, 손님에게 듣고 느낀 것들을 바텐더와 주방조리를 할 때, 바텐더,주방 매니저님과 상의 후 실제적으로 대입함으로써 손님이 원하는 서비스를 제공하게 되는 등 제가 맡은 분야에서의 업무시야가 더욱 넓어졌습니다.\n이처럼 입사 초반에는 작은 것 하나하나 더욱더 신중을 가해 실수부터 줄여나가는 등 업무적응에 가장 힘쓸 것이며, 수시로 동료들과 의견을 자주 나누고, 선배님들에게 적극적으로 조언을 구하여 수행할 수 있는 분야를 넓히기 위해 끝없이 공부하며 필요하다고 생각하는 자격증들을 취득하는 등 자기계발에 힘쓸 것입니다. 이와 같이, 회사의 무궁한 발전을 위해 제가 무엇을 할 수 있을지에 대해 생각하는 시간을 수시로 갖는다면, 탁월한 전문인력으로 성장함과 동시에 회사와 사회발전에 크게 기여 할 것이라 확신합니다.\n\n지원동기 및 경력사항\n[설레고 뿌듯하게 일하는 직원이 되겠습니다.]\n얼마 전까지, 군 생활을 상근예비역 행정병으로 복무하고 전역했습니다.\n주로 맡았던 업무는 ‘국방동원정보체계’라는 국군 예비군서버를 통해 2000명 가까이의 예비군관리 업무와 예비군훈련 준비 및 문의응대, 공문 작성 후 상급부대 제출 등을 담당하였습니다. 또한 예비군훈련 연기·보류에 대한 온·오프라인 신청 접수와 처리 후 결과 안내도 맡았으며, 예비군 개개인의 훈련 통지 및 홍보문자, 메일, 우편발송, 자택으로 직접 방문하여 통지서를 전달하기도 하였습니다.\n예비군들의 훈련관리, 문의응대와 연기·보류접수 업무를 통해 예비군들에게 확실하고 빠르게 원하는 것을 해결해주는 이 상근 생활을, 전역만 기다리며 출근하기 싫어하는 동료들도 있었지만, 저는 집중력을 발휘하여 최선을 다해 노력한 성과를 인정받을 때가 가장 설레고 뿌듯하기에 개인시간도 아낌없이 투자하여 일하다보니, 저절로 일에 재미가 붙어, 매일 아침이 기대가 되고 출근을 기다리게 되었습니다. 이와 같이 이러한 업무가 제게 알맞다고 생각했고 재미있었기에 유사한 업무를 찾아보게 되었고, 이 모집공고를 보게 되어 지원하게 되었습니다.',8003190128161006,1,NULL,'2019-01-28 16:13:35',49,0,211,NULL,NULL,'remind96',NULL,NULL,NULL,'010-4384-8003','3','0','N','N',NULL,NULL,127.025488,37.63974,1,'user/8003190128161006/1548405001006.jpg','user/8003190128161006/1548405001006.jpg',24,'M',178,65,'N',NULL,'N','N','99','0','Y',0,0,0,0,NULL,NULL,NULL,NULL
