'열심히 하겠습니다',NULL,'성장과정 \n\n친구 같고 내면의 사랑과 희생으로 언제나 저희를 뒷바라지 하신 부모님 아래서 오빠와 저는 정직, 성실, 사랑 가훈 아래 행복하게 성장하였습니다. 어려울지라도 묵묵히 일을 하시는 꾸준함 속에 최선을 다하는 모습을 배울 수 있었고 긍정적이고 낙관적인 자세와 강인한 생활력을 배울 수 있었습니다.\n\n학창 시절 내내 친구들과 친밀한 관계를 유지했고 또한 그 시절 저와 인연을 맺은 친구들은 지금까지도 절친하게 지내오고 있을 정도로 인간 관계를 중시합니다.\n\n성격의 장단점\n\n저의 장점은 긍정적이고 끈기 있는 성격 입니다. 자격증 시험에 낙방하며 포기하고 싶은 순간도 많았지만 긍정적인 생각으로 `다음 번에 더 잘 하면 되지` 생각하며 끊임없이 도전하였습니다. 꾸준히 자격증 취득을 목표로 시간 안에 작성하기, 점수 올리기 등으로 꾸준히 연습했고, 그 결과 점수가 향상되어 합격할 수 있었습니다. 칠전팔기의 도전 정신으로 포기하지 않았을 때 얻을 수 있었던 기쁨이었습니다. 이처럼 상황에서 일어나는 실패의 경험들이 많더라도 이를 보완할 수 있는 것을 더 열심히 공부하며 노력합니다. 실패를 계기로 나를 발전시키고, 아무리 힘들어도 포기하지 않는 끈기와 인내력을 가지고 있는 것은 누구보다 가장 높일 수 있는 저의 장점입니다.\n\n저의 단점은 한 가지에 몰두하면 다른 것들을 잊어버릴 때가 있는데 때문에 메모를 자주하고 계획표를 세우는 습관을 들여서 꼭 해야 될 것들을 점검하고 여러가지를 돌아보려고 노력합니다. 또한 완벽주의적 기질 때문메 제 자신을 몰아세우다보면 스스로에게 지칠 때가 있는데 항상 나무보다 숲을 보려는 여유로 넓은 시각을 가지려고 노력하고 있습니다.\n\n지원동기 및 입사 후 포부\n\n사회 생활을 통해 사회 경험을 하고 싶고 어떤 일이던 부딛치고 경험을 쌓고 자신감을 키우고 싶어서 지원 했습니다. 열심히 하겠습니다.',525190202121852,1,NULL,'2019-02-02 12:31:29',356,0,114,NULL,NULL,'tj',NULL,NULL,NULL,'010-2363-0525','3','0','N','N',NULL,NULL,126.7314909,37.4473449,1,'user/0525190202121852/20190202_122939.jpg','user/0525190202121852/20190202_122939.jpg',28,'F',157,56,'N',NULL,'N','N','99','0','Y',0,0,0,0,NULL,NULL,NULL,NULL
