'인테리어시공경력20년차 모든시공가능합니다',NULL,'인테리어시공 도우미 “ 노가다특공대” 입니다. \n저희 대원들은 인테리어시공경력 15년 이상의 경력자들중 책임감있게 시공가능한 대원들만 선발하여 인테리어시공에 어려움을 겪고 계시는 인테리어시공업체를 지원하고 있습니다. \n무책임한 일당인력기공들과는 비교를 거부합니다. \n일단 필요하실 때 써보시고 판단해 주시기 바랍니다. \n간단한 A/S 시공부터 목공사, 용접공사, 전기공사, 설비공사, 타일공사, 방수공사, 페인트공사 등  3D 도면 작업 및 견적과 미팅업무까지 모든 인테리어에 필요한 모든걸 책임지고 지원해 드립니다. \n이젠 시공은 인테리어 시공 도우미 “노가다특공대”에게 맡기시고 편안하게 인테리어사업을 하시기 바랍니다. \n노가다특공대장 (아킨) :  010-4667-8131',8117190104054236,1,NULL,'2019-02-04 10:27:28',32,0,140,NULL,NULL,'노가다맨',NULL,NULL,NULL,'010-9118-8117','1','25','N','N',NULL,NULL,127.1775942,37.2410999,1,'user/8117190104054236/15348376526142e63f65e08403980e55a376227fd2cdd1841973aaf3787ad4acf343eac02443aff273642e7ee5b29dbf5e0af870596fe82e49cbb2ffdc4302d8844e6a81c0774.jpg,user/8117190104054236/15348376526142e63f65e08403980e55a376227fd2cdd1841973aaf3787ad4acf343eac02443aff273642e7ee5b29dbf5e0af870596fe82e49cbb2ffdc4302d8844e6a81c0774.jpg','user/8117190104054236/15348376526142e63f65e08403980e55a376227fd2cdd1841973aaf3787ad4acf343eac02443aff273642e7ee5b29dbf5e0af870596fe82e49cbb2ffdc4302d8844e6a81c0774.jpg',47,'M',175,76,'Y',NULL,'N','N','99','3','Y',0,0,0,0,NULL,NULL,NULL,NULL
