'성실한 근태,마음가짐 보여드릴 자신 있습니다!',NULL,'안녕하십니까 저는 올해로 26살이 되는 김건희 라고 합니다.\n저는 강원도 동해시에 있는 묵호고등학교라는곳에서 졸업을 하고 대학진학을 포기하고 성인이 되고 바로 사회생활을 시작하였습니다. \n요리로 사화생활울 시작하여 보안업체, 공장,택배 등 여러가지 일을하엿고 간간히 알바도 해본 경험이 있습니다.\n우선 한우물을 파지않고 여러가지 경험을 한것이 어떻게보면 단점이고 장점이 될수도 있던것 같습니다.\n여러가지 일들을 해보고 경험했던 일들은 뒤로하고 시간이 지날수록 정착을 해야한다는 생각이 많이 드는것같습니다.\n제 성격은 생각하는게 너무 깊고 많으며 사람이 흑과 백으로 나뉠순 없는것 같아 생각하는 것 때문에 내향적 성향과 외향적 성향을 둘다 가지고 있습니다.\n그래도 사람들과 잘어울리며 관계에 노력을 많이하는 편입니다.\n저는 입사를 하게된다면 일단 가장 기본이지만 어떻게보면 어려운 근태 하나는 정말 성실하게 지키겠습니다.\n그리고 시간이 지나면 나태해지기 마련인데 정말 처음과 같은 마음으로 일을 하겠습니다.\n마지막으로 정말 열심히 배우겠습니다.\n배움에 끝이없다는 생각으로 귀담아듣고 눈으로 보고 경험하며 정말 열심히 하겠습니다.\n길진 않지만 제 소개를 읽어주셔서 정말 감사합니다',2649190220193412,1,NULL,'2019-02-20 19:37:18',2,0,174,NULL,NULL,'김건희',NULL,NULL,NULL,'010-7228-2649','1','11','N','N',NULL,NULL,126.8308176,37.3219123,1,'','',26,'M',177,77,'Y',NULL,'N','N','0','99','Y',0,0,0,0,NULL,NULL,NULL,NULL
