'일을구하고있습니다...',NULL,'성장과정 :   친구들과 친하게지내며 비밀이있는\n            고민이나   말하기곤란한 고민을  마음놓코\n            털어놓을정도로 저를 실뢰하며 고민을 들어\n            주고  좋은조언을 하며..  친구들이저를 많이\n            의지하는 친구들과  기분좋케10대를지내왓\n           습니다....  마냥좋은10대에 생활을 지낼순\n           없지만..  안좋은10대도 있었지만  주록운동\n           을해서  안좋은상황에 스트레스를 풀고햇\n           던것 같습니다...\n\n성격장점:  잘웃는편이다... 내가할수있능 최대한\n            고민을 들어준다...\n성격단점:  잘웃는만큼 상처도 쉽게받는다...\n\n앞으로각오: 모르는것이 많습니다.. 모르는만큼 여쭈어가면서  일하겟습니다... 귀찮타고생각하지마시고.. 좋은 뜻으로 도와주세요',7506190301163707,1,NULL,'2019-03-01 16:47:42',74,0,225,NULL,NULL,'킹별',NULL,NULL,NULL,'010-2760-7506','3','0','N','N',NULL,NULL,126.8319831,37.6583981,1,'user/7506190301163707/B612_20190224_084405_138.jpg','user/7506190301163707/B612_20190224_084405_138.jpg',28,'M',178,70,'Y',NULL,'N','N','0','99','Y',0,0,0,0,NULL,NULL,NULL,NULL
