'군필,24세,건설기초교육수료',NULL,'안녕하세요. 조공 잡부 지원합니다.\n저는 동작구 상도동에 거주하고 있는 24살 휴학생(군필,174cm,70kg) 임원입니다. \n제 장점은\n1.휴학생,군필,건설기초교육수료,대중교통2시간 이내 거리 다 갑니다.\n- 이른근무,연장근무 가능합니다. \n2.시간약속철저\n-근무지가 아무리 멀어도 근무시간보다 10분 일찍 도착하려고 대중교통 도착예정시간보다 30분이상 일찍 출발합니다.\n밑에 쓴 경력사항 중 늦었던 경우는 판교 알바 당시 마을버스가 30분에 한대 와서 10분 늦은적 딱 한번 있습니다.\n고용주님께 드리고 싶은말\n-제대로 된 일을 하려면 가까운 거리 알바생보다 저 같이 경력많은 알바생을 쓰는게 고객 응대 및  돌발상황 대처에서 차이가 난다고 생각합니다.\n-별명이 도라에몽주머니 일정도로 준비성이 철저합니다. 어떤 일을 하든 메모지,펜,장갑 및 개인청결도구를 가지고 일을 합니다. -고용주분들이 지시를 하면 묵묵히 제가 맡은 일에 책임감을 갖고 일을 합니다. 상호도움이 되어 좋은 사회 경험을 쌓고 싶습니다.\n ',4532190603072243,1,NULL,'2019-06-17 11:52:12',1,0,185,NULL,NULL,'23사군필',NULL,NULL,NULL,'010-4115-4532','1','12','N','N',NULL,NULL,0,0,1,'user/4532190603072243/여권.jpg','user/4532190603072243/여권.jpg',24,'M',174,75,'Y',NULL,'N','N','99','0','N',0,0,0,0,NULL,NULL,NULL,NULL
