'기술 배우며 일하고자 합니다. 현장경력 1개월',NULL,'올해 나이 서른살이며 서울 은평구 거주중입니다.\n안전교육 이수증은 19.06.17 발급 받았고\n08월 1일부터 현장일을 시작했습니다.\n\n하던 일은 천장에 환기장치를 시공하는 일이었습니다.\n고속절단기로 전산볼트 및 스파이럴 자르고 \n스파이럴과 부속품 피스로 연결하고 렌탈 타서 제품 다는거 돕는거랑 요비선으로 벽 관로에 선깔고 제품과\n결선하는일 등등을 했습니다.\n\n그만두는 이유는 현재 점심만 제공받고 숙소 없이 \n출퇴근하며 11만원 받고 있는데 기본 일급 + 식비 + 기름값 + 출퇴근으로 쓰는 시간 등을 계산해보니\n숙식제공 일급 12만원과 비교해서 \n하루에 4~5만원 정도 손해보고 있다는 결론이 나왔습니다.\n\n첫 현장이라 뭣도 모르고 했는데 좀 알고나니\n바꾸는게 맞는 것 같습니다.\n공수도 저번달에 20공수 나왔습니다...\n\n희망 사항은 숙식제공 일급 12만원이며 \n4대는 있어도 되고 없어도 됩니다.\n공수는 사계절 28~30공수는 나왔으면 좋겠습니다.\n',987190614192533,1,NULL,'2019-09-17 08:08:58',18,0,191,NULL,NULL,'사람남성',NULL,NULL,NULL,'010-2478-0987','1','12','N','N',NULL,NULL,126.9291627,37.60278,1,'','',30,'M',176,78,'Y',NULL,'N','N','99','0','N',0,0,0,0,NULL,NULL,NULL,NULL
