'일자리를 구합니다..',NULL,'경력사항 \n20살부터 사회생활을 시작하게 되었습니다. 첫 경험은 잠깐의 곶감 아르바이트로 시작되었습니다. 22살부터 25살까지 조선일보 상주지국에서 근무하였습니다. 26살 때쯤에 요리에 관한 관심을 가지고 요리사로 근무하였습니다. 근무지는 대전에서 먼저 요리사를 하다가, 사장님의 요청으로 김포로 발령받아 근무하다가, 다른 경험을 더 많이 얻기 위해서 27살쯤에 다른 직장으로 옮겼습니다. 28살 되어서 서울에 있는 면세점에서 수신호 업무도 경험해 보았습니다. 현재 취업준비 중입니다. 어떠한 일이든지 불러주신다면 열심히 하겠습니다. \n\n성장 과정 및 학창시절 \n초등학교 때는 상주동부초등학교에서 다녔습니다. 중학교는 상주중학교에 다녔습니다. 고등학교는 상산전자고등학교를 다녔습니다. 대학교는 다니고 싶었으나 가정경제난으로 인해 원치 않게 다니고 싶어도 못 다녔습니다. 학창시절에 친구들과의 친교는 원만히 잘 이루어졌습니다. 요즘 들어서도 친구들과 자주 연락하고 재밌게 보내고 있습니다. 성격의 장단점 저의 장점은 인사성이 밝고 사교성이 적극적입니다. 나의 첫인상은 내성적이고 수줍은 모습이 많이 보일 것입니다. 하지만 나의 용기로 이러한 단점들을 극복해 나아가려고 항상 노력하고 있습니다. \n\n희망포부 \n미래에 대한 비전과 자기 계발로 인해 속마음과 생각이 많은 편이라서 위로하는 마음으로 가끔 혼잣말할 때가 있지만 전혀 이상한 사람은 아닙니다. 지금까지의 삶 속에서 좋은 사람들을 많이 만나서 마음의 위로가 많이 되었습니다. 하지만 저는 서울에서 홀로 생활을 하고 있기에 가끔 외로울 때가 있지만, 이것 또한 잘 극복하고 있습니다. 어떡한 업무라도 장기근속을 할 수 있는 마음이 충분히 있고 꼭 직장에 필요한 사람이 되겠습니다.',5586190910063441,1,NULL,'2019-09-10 06:41:54',19,1,227,NULL,NULL,'태준89',NULL,NULL,NULL,'010-4641-5586','3','0','N','N',NULL,NULL,126.8960076,37.5264324,1,'user/5586190910063441/20190831_155331.jpg','user/5586190910063441/20190831_155331.jpg',31,'M',166,54,'N',NULL,'N','N','2','99','Y',0,0,0,0,NULL,NULL,NULL,NULL
