'1년 365일, 근면 성실!!',NULL,'현재 일당제로 샷시 철거 현장에서 14만 받고 일하고 있습니다. (용역이라 똥떼고 12.5만)\n\n똥떼기에 지쳐 다이렉트로 일을 구해봅니다.\n\n현장 경력은 4년차며, 용역으로 일한지는 3개월정도 됐네요.\n\n이천 SK 하이닉스 등의 대기업 현장에서 수장도 했었고, 중소기업에서 방수와 외장 판넬일도 조금 했었습니다.\n\n지금까지 현장일 하면서 한번도 일 못한다는말 들어본적 없고, 정말 열심히 일하고 있습니다. \n\n일당제라고 절대로 대충 일하지 않아요.\n단 하루를 해도 내일처럼 정말 열심히 일합니다.\n\n(사정상 9월달은 일당, 10월부터는 주급 가능)\n\n일당은 13~14만 생각하고 있습니다.\n\n(일요일 및 공휴일도 일 가능)\n\n■ 010-2955-5488\n\n광명사거리역에서 1시간 넘지 않는거리 원해요.\n\n(숙식 가능시 수도권은 모두 가능해요)\n',5488190719085830,1,NULL,'2019-11-17 14:21:27',103,2,634,NULL,NULL,'근면성실',NULL,NULL,NULL,'010-2955-5488','3','0','N','N',NULL,NULL,126.8646504,37.4786175,1,'user/5488190719085830/Screenshot_20190704-200301.jpg,user/5488190719085830/image.jpg','user/5488190719085830/Screenshot_20190704-200301.jpg',39,'M',174,63,'Y',NULL,'N','N','99','1','N',0,0,0,0,NULL,NULL,NULL,NULL
