'판넬 크린룸 경량 인테리어 실내현장',NULL,'성실하게 시간약속지키며 일할수있습니다.\n크린룸 해썹 으로만 7년정도 일했고 철골이나 간단한 용접 가능하고 플랜트 냉동판넬은 한번정도밖에 경험없습니다.\n외장판넬은 안합니다.\n기공조공 일할사람 여럿 있습니다\n현장은 경기 외곽이나 서울  \n지방출장은 공사규모에 따라 가능여부 말씀드릴게요\n일당은 15인데 남양주 근처는 이일당에도 나갈수있습니다.\n 현장이 멀면 협의입니다  일하는 속도보시고 협의보면될것같습니다.\n전기 덕트 타일 설비 미장 배관 \n건축업에 종사하며 여러가지 경험을쌓아 같이 몇일 일해보시면 알거에요\n자차있구요  \n판넬 조공 1  준기공1  조공2명까지 일할수있습니다.\n도면 주시면 알아서 빨리빨리 일해드릴수있습니다.\n공구는 필요하시면 미리말씀해주셔야합니다.\n',8722191025205408,1,NULL,'2019-10-25 21:16:15',1,2,25,NULL,NULL,'조성민',NULL,NULL,NULL,'010-7679-8722','1','15','N','N',NULL,NULL,127.2164716,37.6359836,1,'','',28,'M',187,73,'Y',NULL,'N','N','99','3','Y',0,0,0,0,NULL,NULL,NULL,NULL
